window.bookSummaryJSON = "<p>At long last, Earth has a handful of starships. Surrounded by Rebel Kher, Imperials, and the mysterious Nomads, humanity dares to assert our right to independence.&nbsp;&nbsp;</p> <p>The interstellar community reacts harshly. In the eyes of our neighbors, we’re upstarts, dangerous beings who don’t know our place.&nbsp;&nbsp;&nbsp;</p> <p>For the Kher, freedom can only be won through battle. War fleets arrive to instruct us, and Captain Leo Blake is again sent out to voyage among hostile stars.&nbsp;&nbsp;&nbsp;</p> <p>We’re far from ready, but the time has come. It’s game on.</p>"; 
